import React from "react";
import articleContent from "./article-content.js";
import { Link } from "react-router-dom";

function Articles() {
  return (
    <div>
      <h1>Articles</h1>
      {articleContent.map(article => (
        <h2>{article.title}</h2>
      ))}
    </div>
  );
}

export default Articles;
